import React from 'react';
import { Card, Container } from 'react-bootstrap';
import './Style.css';
import selfPicture from './../img/selfPicture.png';
import { FaFacebook } from 'react-icons/fa';

function PictureContainer() {

    return (
        // <Container id="picture_container">
        //   <div id="profileCard">
        //     <img src={selfPicture} alt="myself" id="selfPicture"/>
        //     <p id="titleName">Andrea Pallotta</p>
        //     <p>Rochester Institute of Technology</p>
        //   </div>
        // </Container>
        <Card id="picture_container">
          <Card.Img variant="top" src={selfPicture} />
          <Card.Title>Andrea Pallotta</Card.Title>
          <Card.Subtitle>
            3rd Year Student at Rochester Institute of Technology
          </Card.Subtitle>
          <Card.Link href="#"><FaFacebook></FaFacebook></Card.Link>
        </Card>
      );
}

export default PictureContainer;
